import React from "react";
import Employee from "./Employee";
import Footer from "./layout/footer";
import Header from "./layout/header";

function App() {
  return (
    <div className="App">
      <Header />
        <main>
          <div className='container'>
            <Employee />
          </div>
        </main>
      <Footer />
    </div>
  );
}

export default App;
